import './App.css';
import {
  // BrowserRouter as Router,
  Route,
  Switch,
  // Redirect
  // useRouteMatch,
  // useParams
} from "react-router-dom";

import Home from './components/home';
import Dashboard from './components/admin/dashboard';
import Login from './components/admin/login';
import FrontendLogin from './components/login';
import Register from './components/register';
import useToken from './components/admin/useToken';
import DoctorList from './components/doctors';
import DoctorsList from './components/admin/doctor-list';



function App() {


  const { token, setToken } = useToken();

  return (
    <div className="App">

      <Switch>

        {/*  */}
        <Route path="/admin" exact>
          <Login setToken={setToken} />
        </Route>

        <Route path="/doctors-list" exact>
          <DoctorsList/>
        </Route>


        <Route path="/dashboard">
          <Dashboard />
        </Route>




        <Route path="/" exact>
          <Home />
        </Route>




        <Route path="/login" exact>
          <FrontendLogin setToken={setToken} />
        </Route>

        <Route path="/register" exact>
          <Register/>
        </Route>


        <Route path="/doctors" exact>
          <DoctorList/>
        </Route>





        {/* <Route path="/signup">
          <RegisterAsUser />
        </Route>
        <Route path="/apply-job/:id">
          <ApplyJob />
        </Route>
        <Route path="/job-list">
          <JobList />
        </Route>
        <Route path="/organizations">
          <Organizations />
        </Route>
        <Route path="/job-candidates/:id">
          <JobCandidates />
        </Route>
        <Route path="/edit-job-details/:job_id" exact>
          <EditPostJob />
        </Route>
        <Route path="/jobs-list/:org_id" exact>
          <AdminJobList />
        </Route>
        <Route path="/user-list" exact>
          <UserList />
        </Route> */}



      </Switch>

    </div>
  );
}

export default App;
